Let $O$ be the center of the octahedron.  Then $OP$ is perpendicular to the plane of the octagon $ABCDEF$, and $P$ is at a distance of $OP$ from each of the vertices $A$, $B$, $C$, $D$, $E$, and $F$.  Let $G$ be the midpoint of $\overline{CD}$, and let $H$ be the midpoint of $\overline{EF}$.  Then $GH$ is parallel to $\overline{AB}$, and $GH = \frac{1}{2} AB = \frac{1}{2} \cdot 7 = \frac{7}{2}$.  Also, $GH$ is perpendicular to $\overline{OP}$, so $GH$ is the base of a right triangle with hypotenuse $\overline{PG}$ and height $OP$.  Let $x = OP$.  Then $PG = \sqrt{x^2 + \left( \frac{7}{2} \right)^2} = \sqrt{x^2 + \frac{49}{4}}$.  Also, $PG = \frac{1}{2} \cdot 9 = \frac{9}{2}$, so $\sqrt{x^2 + \frac{49}{4}} = \frac{9}{2}$.  Squaring both sides, we get $x^2 + \frac{49}{4} = \frac{81}{4}$, so $x^2 = \frac{32}{4} = 8$, and $x = \sqrt{8} = 2 \sqrt{2}$.  Therefore, the distance from $P$ to $G$ is $2 \sqrt{2}$.

